<span class="line"><span style="color:#A6ACCD;">        </span><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">bindApplication</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;">VIEW_AP_APPLICATION</span><span style="color:#89DDFF;">&lt;/</span><span style="color:#F07178;">bindApplication</span><span style="color:#89DDFF;">&gt;</span></span>
