<span class="line"><span style="color:#A6ACCD;">    </span><span style="color:#676E95;">&lt;!-- Decide which BU this API will apply to. Could apply to multiple BU,use &quot;,&quot; as separator.Available value:AP/NA/EA/SA   --&gt;</span></span>
